import TopButtonGroup from "../organisms/topButtonGroup";
import FooterGroup from "../molecules/footerGrop";

const RegisterPage = () => {
    const step = 'step2';
    return(
        <div>
            <TopButtonGroup step={step}/>
            <FooterGroup />
        </div>
    )
}
export default RegisterPage;
